import React from "react";
import notes from "./notes";
function notesapp(note){
    return <div class="note">
        <h1 >{note.title}</h1>
        <p>{note.content}</p>
    </div>;
}
function Note(){
    return <div className="note">
        {notes.map(notesapp)};
    </div>;
}

export default Note;
